i project</a> to get an overview of typical uses of Semantic MediaWiki.\nSee the Semantic MediaWiki homepage for <a href=\"https://semantic-mediawiki.org/wiki/Registry\">further information about this service</a>.\";'),(_binary 'en','messages:smw_smwadmin_announcebutton',_binary 's:193:\"Press the following button to submit your wiki URL to that service.\nThe service will not register wikis that are not publicly accessible, and it will only store publicly accessible information.\";'),(_binary 'en','messages:smw_smwadmin_datarefresh',_binary 's:23:\"Data repair and upgrade\";'),(_binary 'en','messages:smw_smwadmin_datarefreshdocu',_binary 's:450:\"It is possible to restore all Semantic MediaWiki data based on the current contents of the wiki.\nThis can be useful to repair broken data or to refresh the data if the internal format has changed due to some software upgrade.\nThe update is executed page by page and will not be completed immediately.\nThe following shows if an update is in progress and allows you to start or stop updates (unless this feature was disabled by the site administrator).\";'),(_binary 'en','messages:smw_smwadmin_datarefreshprogress',_binary 's:428:\"<strong>An update is already in progress.</strong>\nIt is normal that the update progresses only slowly since it only refreshes data in small chunks each time a user accesses the wiki.\nTo finish this update more quickly, you can invoke the MediaWiki maintenance script <code>runJobs.php</code> (use the option <code>--maxjobs 1000</code> to restrict the number of updates done in one batch).\nEstimated progress of current update:\";'),(_binary 'en','messages:smw_smwadmin_datarefreshbutton',_binary 's:19:\"Start updating data\";'),(_binary 'en','messages:smw_smwadmin_datarefreshstop',_binary 's:16:\"Stop this update\";'),(_binary 'en','messages:smw_smwadmin_datarefreshstopconfirm',_binary 's:29:\"Yes, I am {{GENDER:$1|sure}}.\";'),(_binary 'en','messages:smw_smwadmin_support',_binary 's:15:\"Getting support\";'),(_binary 'en','messages:smw_smwadmin_supportdocu',_binary 's:53:\"Various resources might help you in case of problems:\";'),(_binary 'en','messages:smw_smwadmin_installfile',_binary 's:218:\"If you experience problems with your installation, start by checking the guidelines in the <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/blob/master/docs/INSTALL.md#smw-installation\">INSTALL file</a>.\";'),(_binary 'en','messages:smw_smwadmin_smwhomepage',_binary 's:135:\"The complete user documentation to Semantic MediaWiki is at <b><a href=\"https://semantic-mediawiki.org\">semantic-mediawiki.org</a></b>.\";'),(_binary 'en','messages:smw_smwadmin_mediazilla',_binary 's:107:\"Bugs can be reported to <a href=\"https://github.com/SemanticMediaWiki/SemanticMediaWiki/issues\">GitHub</a>.\";'),(_binary 'en','messages:smw_smwadmin_questions',_binary 's:186:\"If you have further questions or suggestions, join the discussion on <a href=\"http://sourceforge.net/mailarchive/forum.php?forum_name=semediawiki-user\">Semantic MediaWiki user forum</a>.\";'),(_binary 'en','messages:smw_adminlinks_datastructure',_binary 's:14:\"Data structure\";'),(_binary 'en','messages:smw_adminlinks_displayingdata',_binary 's:12:\"Data display\";'),(_binary 'en','messages:smw_adminlinks_inlinequerieshelp',_binary 's:19:\"Inline queries help\";'),(_binary 'en','messages:smw-createproperty-isproperty',_binary 's:30:\"This is a property of type $1.\";'),(_binary 'en','messages:smw-createproperty-allowedvals',_binary 's:82:\"The allowed {{PLURAL:$1|value for this property is|values for this property are}}:\";'),(_binary 'en','messages:smw-paramdesc-category-delim',_binary 's:13:\"The delimiter\";'),(_binary 'en','messages:smw-paramdesc-category-template',_binary 's:35:\"A template to format the items with\";'),(_binary 'en','messages:smw-paramdesc-category-userparam',_binary 's:35:\"A parameter to pass to the template\";'),(_binary 'en','messages:smw-info-par-message',_binary 's:19