s with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),(_binary 'en','messages:smw-sp-properties-docu',_binary 's:330:\"This page shows [https://www.semantic-mediawiki.org/wiki/Property properties] that are available and when filtered, only user-defined properties that match the condition are displayed. For a differentiated view, see the special page [[Special:UnusedProperties|unused properties]] or [[Special:WantedProperties|wanted properties]].\";'),(_binary 'en','messages:smw-sp-properties-cache-info',_binary 's:123:\"The listed data have been retrieved from [https://www.semantic-mediawiki.org/wiki/Caching cache], and were last updated $1.\";'),(_binary 'en','messages:smw-sp-properties-header-label',_binary 's:18:\"List of properties\";'),(_binary 'en','messages:smw-sp-admin-settings-title',_binary 's:22:\"Configuration settings\";'),(_binary 'en','messages:smw-sp-admin-settings-docu',_binary 's:247:\"Displays a list of all default and localized settings that are relevant to the Semantic MediaWiki environment. For details on individual settings, please consult the [https://semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),(_binary 'en','messages:smw-sp-admin-settings-button',_binary 's:22:\"Generate settings list\";'),(_binary 'en','messages:smw-sp-admin-idlookup-title',_binary 's:15:\"ObjectId lookup\";'),(_binary 'en','messages:smw-sp-admin-idlookup-docu',_binary 's:130:\"Displays details about an internal object Id that represents individual entities (wikipage, subobject etc.) in Semantic MediaWiki.\";'),(_binary 'en','messages:smw-sp-admin-idlookup-objectid',_binary 's:10:\"Object Id:\";'),(_binary 'en','messages:smw-livepreview-loading',_binary 's:10:\"Loading...\";'),(_binary 'en','messages:smw-sp-searchbyproperty-description',_binary 's:313:\"This page provides a simple [https://www.semantic-mediawiki.org/wiki/Help:Browsing_interfaces browsing interface] for finding entities described by a property and a named value. Other available search interfaces include the [[Special:PageProperty|page property search]], and the [[Special:Ask|ask query builder]].\";'),(_binary 'en','messages:smw-sp-searchbyproperty-resultlist-header',_binary 's:15:\"List of results\";'),(_binary 'en','messages:smw-sp-searchbyproperty-nonvaluequery',_binary 's:54:\"A list of values that have the property \"$1\" assigned.\";'),(_binary 'en','messages:smw-sp-searchbyproperty-valuequery',_binary 's:66:\"A list of pages that have property \"$1\" with value \"$2\" annotated.\";'),(_binary 'en','messages:smw-datavalue-number-textnotallowed',_binary 's:65:\"\"$1\" can not be assigned to a declared number type with value $2.\";'),(_binary 'en','messages:smw-editpage-annotation-enabled',_binary 's:557:\"This page supports semantic in-text annotations (e.g.<nowiki>\"[[Is specified as::World Heritage Site]]\"</nowiki>) to build structured and queryable content provided by Semantic MediaWiki. For a comprehensive description on how to use annotations or the #ask parser function, please have a look at the [https://www.semantic-mediawiki.org/wiki/Help:Getting_started getting started], [https://www.semantic-mediawiki.org/wiki/Help:In-text_annotation in-text annotation], or [https://www.semantic-mediawiki.org/wiki/Help:Inline_queries inline queries] help page.\";'),(_binary 'en','messages:smw-editpage-annotation-disabled',_binary 's:232:\"This page is not enabled for semantic in-text annotations due to namespace restrictions. Details about how to enable the namespace is described on the [https://semantic-mediawiki.org/wiki/Help:Configuration configuration] help page.\";'),(_binary 'en','messages:smw-editpage-property-annotation-enabled',_binary 's:470:\"This property can be extended using semantic annotations to specify a data type (e.g.<nowiki>\"[[Has type::Page]]\"</nowiki>) or other supporting declarations e.g.<nowiki>\"[[Subproperty of::dc:date]]\"</nowiki>). For a description on how to augment this page, see the [https://www.semantic-mediawiki.org/wiki/Help:Property_declaration declaration of a property] or the [https://www.semantic-mediawiki.org/wiki/Help:List_of_datatypes list of available data types] help page.\";'),(_binary 'en','messages:smw-editpage-property-annotation-disabled',_binary 's:259:\"This property cannot be extended with a data type annotation (e.g.<nowiki>\"[[Has type::Page]]\"</nowiki>) as it is already predefined (see the [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special properties] help page for more information).\";'),(_binary 'en','messages:smw-editpage-concept-annotation-enabled',_binary 's:189:\"This concept can be extended using the #concept parser function. For a description on how to use #concept, see the [https://www.semantic-mediawiki.org/wiki/Help:Concepts concept] help page.\";'),(_binary 'en','messages:log-name-smw',_binary 's:22:\"Semantic MediaWiki log\";'),(_binary 'en','messages:log-description-smw',_binary 's:155:\"Activities for [https://www.semantic-mediawiki.org/wiki/Help:Logging enabled event types] that have been reported by Semantic MediaWiki and its components.\";'),(_binary 'en','messages:smw-datavalue-import-unknownns',_binary 's:121:\"The import namespace \"$1\" is unknown. Please ensure that owl import details are available via [[MediaWiki:Smw import $1]]\";'),(_binary 'en','messages:smw-pa-property-predefined_impo',_binary 's:431:\"\"$1\" is a predefined property (also known as [https://www.semantic-mediawiki.org/wiki/Help:Special_properties special property]) that describes a relation to an [https://semantic-mediawiki.org/wiki/Help:Import_vocabulary imported vocabulary]. It is a built-in property that comes with additional administrative privileges but can be used just like any other [https://www.semantic-mediawiki.org/wiki/Property user-defined property].\";'),(_binary 'en','messages:maps-desc',_binary 's:107:\"Enables embedding of dynamic maps into wiki pages, geocoding of addresses and other geographical operations\";'),(_binary 'en','messages:right-geocode',_binary 's:7:\"Geocode\";'),(_binary 'en','messages:action-geocode',_binary 's:25:\"do geocoding on this wiki\";'),(_binary 'en','messages:maps_map',_binary 's:3:\"Map\";'),(_binary 'en','messages:maps-tracking-category',_binary 's:47:\"Pages with a map rendered by the Maps extension\";'),(_binary 'en','messages:maps-loading-map',_binary 's:14:\"Loading map...\";'),(_binary 'en','messages:maps-load-failed',_binary 's:23:\"Could not load the map!\";'),(_binary 'en','messages:maps-markers',_binary 's:7:\"Markers\";'),(_binary 'en','messages:maps-copycoords-prompt',_binary 's:13:\"CTRL+C, ENTER\";'),(_binary 'en','messages:maps-searchmarkers-text',_binary 's:14:\"Filter markers\";'),(_binary 'en','messages:maps-others',_binary 's:6:\"others\";'),(_binary 'en','messages:maps-kml-parsing-failed',_binary 's:105:\"Failed parsing one or more KML files. Usually this happens because of retrieval failure or malformed XML.\";'),(_binary 'en','messages:maps-ns-layer',_binary 's:5:\"Layer\";'),(_binary 'en','messages:maps-ns-layer-talk',_binary 's:10:\"Layer talk\";'),(_binary 'en','messages:maps-layer-property',_binary 's:8:\"Property\";'),(_binary 'en','messages:maps-layer-value',_binary 's:5:\"Value\";'),(_binary 'en','messages:maps-layer-errors',_binary 's:6:\"Errors\";'),(_binary 'en','messages:maps-layerdef-invalid',_binary 's:44:\"Invalid {{PLURAL:$1|definition|definitions}}\";'),(_binary 'en','messages:maps-layerdef-invalid-fatal',_binary 's:24:\"Fatal invalid definition\";'),(_binary 'en','messages:maps-layerdef-wrong-namespace',_binary 's:59:\"Layer definitions are only valid on pages of namespace \"$1\"\";'),(_binary 'en','messages:maps-layerdef-equal-layer-name',_binary 's:99:\"Layer names must be unique within the same layer page. \"$1\" is already being used by another layer.\";'),(_binary 'en','messages:maps-layerpage-usage',_binary 's:32:\"Pages with maps using layer \"$1\"\";'),(_binary 'en','messages:maps-layerpage-nousage',_binary 's:44:\"No pages are using this layer at the moment.\";'),(_binary 'en','messages:maps-error-invalid-layertype',_binary 's:95:\"There are no layers of type \"$1\". Only {{PLURAL:$3|this type is|these types are}} supported: $2\";'),(_binary 'en','messages:maps-error-no-layertype',_binary 's:97:\"You need to specify the layer type. {{PLURAL:$2|Only this type is|These types are}} supported: $1\";'),(_binary 'en','messages:validation-error-invalid-layer',_binary 's:37:\"Parameter \"$1\" must be a valid layer.\";'),(_binary 'en','messages:validation-error-invalid-layers',_binary 's:48:\"Parameter \"$1\" must be one or more valid layers.\";'),(_binary 'en','messages:validation-error-no-non-numeric',_binary 's:44:\"Parameter \"$1\" must be a non-numeric string.\";'),(_binary 'en','messages:validation-error-no-non-numerics',_binary 's:55:\"Parameter \"$1\" must be one or more non-numeric strings.\";'),(_binary 'en','messages:maps-layer-of-type',_binary 's:18:\"Layer of type \"$1\"\";'),(_binary 'en','messages:maps-layer-of-type-and-name',_binary 's:23:\"Layer \"$2\" of type \"$1\"\";'),(_binary 'en','messages:maps-layer-type-supported-by',_binary 's:115:\"This layer type can {{PLURAL:$2|only be used with the $1 mapping service|be used with these mapping services: $1}}.\";'),(_binary 'en','messages:maps-coordinates-description',_binary 's:76:\"Parser hook to format coordinates, from and to any of the supported formats.\";'),(_binary 'en','messages:maps-displaymap-description',_binary 's:67:\"Display geographical maps without any wiki-defined markers on them.\";'),(_binary 'en','messages:maps-distance-description',_binary 's:87:\"Convert a distance using a certain supported unit to its equivalent using another unit.\";'),(_binary 'en','messages:maps-finddestination-description',_binary 's:123:\"Find a destination given a starting point (that can be in any of the supported formats), an initial bearing and a distance.\";'),(_binary 'en','messages:maps-geocode-description',_binary 's:211:\"Enables the geocoding of addresses, in other words, turning human readable locations into sets of coordinates. There is support for several geocoding services, which should not be confused with mapping services.\";'),(_binary 'en','messages:maps-geodistance-description',_binary 's:97:\"Calculate the geographical distance between two points, from and to any of the supported formats.\";'),(_binary 'en','messages:maps-mapsdoc-description',_binary 's:120:\"Display a table with the parameters for a specified mapping service together with their default values and descriptions.\";'),(_binary 'en','messages:maps-layerdefinition-description',_binary 's:73:\"Describes a custom layer which can be displayed with other Map functions.\";'),(_binary 'en','messages:maps-mapsdoc-par-service',_binary 's:59:\"The mapping service to display parameter documentation for.\";'),(_binary 'en','messages:maps-mapsdoc-par-language',_binary 's:118:\"The language in which to display the documentation. If no such translation is available, English will be used instead.\";'),(_binary 'en','messages:maps-coordinates-par-location',_binary 's:35:\"The coordinates you want to format.\";'),(_binary 'en','messages:maps-coordinates-par-format',_binary 's:38:\"The target format for the coordinates.\";'),(_binary 'en','messages:maps-coordinates-par-directional',_binary 's:68:\"Indicates if the coordinates should be outputted directional or not.\";'),(_binary 'en','messages:maps-distance-par-distance',_binary 's:64:\"The distance to convert to its equivalent with a specified unit.\";'),(_binary 'en','messages:maps-distance-par-decimals',_binary 's:70:\"The maximum number of fractional digits to use in the resulting value.\";'),(_binary 'en','messages:maps-distance-par-unit',_binary 's:35:\"The unit to output the distance in.\";'),(_binary 'en','messages:maps-finddestination-par-lo