ostings from the public, like this wiki, are often abused by spammers who use automated tools to post their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may show you an image of colored or distorted text and ask you to type the words shown.\nSince this is a task that\'s hard to automate, it will allow most real humans to make their posts while stopping most spammers and other robotic attackers.\n\nUnfortunately this may inconvenience users with limited vision or using text-based or speech-based browsers.\nAt the moment we do not have an audio alternative available.\nPlease contact the [[Special:ListAdmins|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate actions.\n\nHit the \"back\" button in your browser to return to the page editor.\";'),(_binary 'en','messages:captcha-addurl-whitelist',_binary 's:285:\" #<!-- leave this line exactly as it is --> <pre>\n# Syntax is as follows:\n#   * Everything from a \"#\" character to the end of the line is a comment\n#   * Every non-blank line is a regex fragment which will only match hosts inside URLs\n #</pre> <!-- leave this line exactly as it is -->\";'),(_binary 'en','messages:right-skipcaptcha',_binary 's:75:\"Perform CAPTCHA-triggering actions without having to go through the CAPTCHA\";'),(_binary 'en','messages:questycaptcha-desc',_binary 's:41:\"Questy CAPTCHA generator for Confirm Edit\";'),(_binary 'en','messages:questycaptcha-addurl',_binary 's:185:\"Your edit includes new external links.\nTo protect the wiki against automated edit spam, we kindly ask you to answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptcha-badlogin',_binary 's:154:\"To protect the wiki against automated password cracking, we kindly ask you to answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptcha-createaccount',_binary 's:153:\"To protect the wiki against automated account creation, we kindly ask you to answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptcha-create',_binary 's:103:\"To create the page, please answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptcha-edit',_binary 's:102:\"To edit this page, please answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptcha-sendemail',_binary 's:145:\"To protect the wiki against automated spamming, we kindly ask you to answer the question that appears below ([[Special:Captcha/help|more info]]):\";'),(_binary 'en','messages:questycaptchahelp-text',_binary 's:720:\"Web sites that accept contributions from the public, like this wiki, are often abused by spammers who use automated tools to add their links to many sites.\nWhile these spam links can be removed, they are a significant nuisance.\n\nSometimes, especially when adding new web links to a page, the wiki may ask you to answer a question.\nSince this is a task that is hard to automate, it will allow most real humans to make their contributions while stopping most spammers and other robotic attackers.\n\nPlease contact the [[Special:ListAdmins|site administrators]] for assistance if this is unexpectedly preventing you from making legitimate contributions.\n\nClick the \"back\" button in your browser to return to the page editor.\";'),(_binary 'en','messages:skinname-vector',_binary 's:6:\"Vector\";'),(_binary 'en','messages:vector-skin-desc',_binary 's:74:\"Modern version of MonoBook with fresh look and many usability improvements\";'),(_binary 'en','messages:vector.css',_binary 's:58:\"/* CSS placed here will affect users of the Vector skin */\";'),(_binary 'en','messages:vector.js',_binary 's:72:\"/* Any JavaScript here will b